「エビス インターケアハブラシ・ロング ふつう 1本」は、歯ブラシとフロスのダブル効果で、歯間徹底ケア+歯周クリーニングができる歯ブラシ(ふつう)です。毛先直径0.02mmの極細フロス毛を使用したホワイト毛で歯間の奥まで徹底ケアし、超先細毛とフラット毛のカラー毛で、歯周ポケットと歯面の歯垢を落とします。ヘラ状毛束(横長)になっていますので、せまい歯間の奥まで入りこみやすく、幅広ヘッドは植毛量が多く、歯との接触面積が広いので、簡単に効率よく歯垢を除去できます。ヘッドの長さ約12%アップ(レギュラーとの比較)。奥歯までしっかりカバーするロングタイプ。※この商品はカラーアソート商品です。色はレッド・イエロー・ブルー・ブラックの4色ございますが、お選びいただけません。何卒ご了承願います。<br />日用品　>　オーラルケア　>　歯ブラシ　>　歯ブラシ ふつう　>　<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
